import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [designs, setDesigns] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchDesigns() {
      try {
        const token = localStorage.getItem('token'); // Or wherever your token is stored
        const res = await fetch('/api/designs', {
          headers: { Authorization: `Bearer ${token}` }
        });
        if (!res.ok) throw new Error('Unable to fetch designs');
        const data = await res.json();
        setDesigns(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    }
    fetchDesigns();
  }, []);

  const openDesign = (design) => {
    navigate('/editor', { state: { design } });
  };

  if (loading) return <p>Loading designs...</p>;
  if (error) return <p>Error: {error}</p>;
  if (designs.length === 0) return <p>No saved designs found.</p>;

  return (
    <div className="p-4">
      <h1>Your Saved Designs</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4 mt-4">
        {designs.map(d => (
          <div key={d._id} className="border p-4 rounded shadow cursor-pointer"
            onClick={() => openDesign(d)}>
            <h2 className="font-bold mb-2">{d.title || 'Untitled'}</h2>
            {d.thumbnailUrl && (
              <img src={d.thumbnailUrl} alt={d.title} className="w-full rounded" />
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
